import { Link } from "react-router-dom";

export default function Card(props) {
  let cardClass = "card mb-3";
  if (props.isActive) {
    cardClass = "card border-dark mb-3";
  }

  return (
    <div className={cardClass}>
      <h5 className="card-title">{props.title}</h5>
      <h6 className="card-subtitle mb-2 text-muted">Street Address</h6>
      <p className="card-text">Avaibility: 100</p>
      {/* <Link className="card-link">More</Link>
        <Link>Edit</Link> */}
      Is Active: {String(props.isActive)}
    </div>
  );
}
